import React from "react";
import "./index.css";
// import bro from"./Used Images/bro.png";
import Ellipse from "./Used Images/Ellipse 190.png";

function HomePage() {
    return (<>

        <div className="position-relative home1">

            <div class="position-absolute container-fluid  start-50 translate-middle bg-success">
                <h3 className=""> Elevate <span>Real Estate Success with</span></h3>
                <h3> Osumare's Digital Expertise</h3>
                <p className="fs-5">Tailored Solutions for Thriving in the Digital Real Estate Landscape</p>

                <button class="btn btn-primary d-grid gap-2 col-7 mx-auto rounded-pill" type="button">Get started</button>
            </div>
            <div class="position-absolute d- col-3 top-0 start-100 translate-middlebg-success">
                <img class="w-100" src={Ellipse} />
            </div>
        </div>
    </>);
}
export default HomePage;
